import React from "react";
import sum, { sub, div,mul } from "./App";

function Cal() {
  return (
    <>
      <ul>
        <li>Sum of two Nub is : {sum(20, 50)}</li>
        <li>Sub of two Nub is : {sub(30, 10)}</li>
        <li>Div of two Nub is : {div(100, 3)}</li>
        <li>Mul of two Nub is : {mul(2, 9)}</li>
      </ul>
    </>
  );
}
export default Cal;
